import './ExpenseItem.css'
const ExpenseItem = () => {
  return (
    <div className="expense-item">
      <div>March 28th 2021</div>
      <div class="expense-item__description">
        <h2 className="">Car Insurance</h2>
        <div>$294.67</div>
      </div>
    </div>
  );
};
export default ExpenseItem;
